import Helmet from "react-helmet";
import React from 'react';
import './Home.css';
import Navbar from "../../components/Navbar";

const Home = () => {
    return (
        <div className="home">
            <Helmet bodyAttributes={{style: 'background-color: var(--color-dark-green)'}}/>
            <Navbar></Navbar>
            <div className="home-body" style={{ backgroundImage: 'url("/your-image.jpg")', backgroundSize: 'cover', backgroundPosition: 'center' }}>
                <div className="googleBtn">
                    <a className="btn btn-google" href="https://play.google.com/store/apps/details?id=com.GrowthPlus&pli=1" 
                    title="Google Play" target="_blank" rel="noreferrer">
                        Google Play
                    </a>
                </div>
            </div>
        </div>
    )
};

export default Home;
